import 'react-native-url-polyfill/auto'
import AsyncStorage from '@react-native-async-storage/async-storage'
import { createClient } from '@supabase/supabase-js'

const supabaseUrl = 'https://lhlsjeirltrxslyrxuwo.supabase.co'
const supabaseAnonKey = 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJzdXBhYmFzZSIsInJlZiI6ImxobHNqZWlybHRyeHNseXJ4dXdvIiwicm9sZSI6ImFub24iLCJpYXQiOjE3MDk3NTg2NzQsImV4cCI6MjAyNTMzNDY3NH0.eB2eUKf03MhNx3FTAkv8JlVFTTvmBuuZjVzbTkCnxPQ'

export const supabase = createClient(supabaseUrl, supabaseAnonKey, {
  auth: {
    storage: AsyncStorage,
    autoRefreshToken: true,
    persistSession: true,
    detectSessionInUrl: false,
  },
})
